module BDNKJacobian

# write does the four equations of motion in the form Fi = Si where i = 1, 2, 3, 4, and F is the function on the LHS which depends on the advanced time level and S, the source term, is the function on the RHS
# which depends on the current time level.

function F1(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return -1152*χ0*(E0 + E1)^2 - 192*λ0*(E0 + E1)^2*(v0 + v1)^2 + 480*χ0*(E0 + E1)^2*(v0 + v1)^2 + 96*λ0*(E0 + E1)^2*(v0 + v1)^4 - 24*χ0*(E0 + E1)^2*(v0 + v1)^4 - 12*λ0*(E0 + E1)^2*(v0 + v1)^6 - 6*χ0*(E0 + E1)^2*(v0 + v1)^6 + 3072*2^0.75*(E0 + E1)*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 - 1280*2^0.75*(E0 + E1)*(v0 + v1)^2*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 + 64*2^0.75*(E0 + E1)*(v0 + v1)^4*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 + 16*2^0.75*(E0 + E1)*(v0 + v1)^6*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 - (128*(k*(4*η0 - 3*λ0 - 4*χ0 + ((16*η0 - 21*λ0 - 16*χ0)*(v0 + v1)^2)/4. - (3*λ0*(v0 + v1)^4)/8.)*(v0m - v0p + v1m - v1p)^2 - h*k*(v0 + v1)*(16*η0 - 33*λ0 - 25*χ0 + (3*(8*η0 - 9*λ0 - 5*χ0)*(v0 + v1)^2)/4.)*(v0m - v0p + v1m - v1p)*(V0 + V1) - 4*h^2*k*(3*(2*λ0 + χ0) + (3*(-4*η0 + 8*λ0 + 5*χ0)*(v0 + v1)^2)/4. + ((-4*η0 + χ0)*(v0 + v1)^4)/8.)*(V0 + V1)^2 + 4*(1 - (v0 + v1)^2/4.)*((v0 + v1)*(k*(4*η0 - 3*λ0 - 4*χ0 - (3*λ0*(v0 + v1)^2)/4.)*(v0m - 2*v0 + v0p + v1m - 2*v1 + v1p) + 2*h^2*(3*(2*λ0 + χ0) + ((-4*η0 + χ0)*(v0 + v1)^2)/4.)*(V0 - V1)) + h*k*(3*(λ0 + χ0) + ((-8*η0 + 9*λ0 + 5*χ0)*(v0 + v1)^2)/4.)*(V0m - V0p + V1m - V1p)))*(ε0 + ε1)^2)/(h^2*k) - (1024*2^0.75*sqrt(1 - (v0 + v1)^2/4.)*(v0m - v0p + v1m - v1p)*(ε0 + ε1)^2.25)/h + (64*2^0.75*(v0 + v1)^4*sqrt(1 - (v0 + v1)^2/4.)*(v0m - v0p + v1m - v1p)*(ε0 + ε1)^2.25)/h + 2048*2^0.75*(v0 + v1)*sqrt(1 - (v0 + v1)^2/4.)*(V0 + V1)*(ε0 + ε1)^2.25 - 512*2^0.75*(v0 + v1)^3*sqrt(1 - (v0 + v1)^2/4.)*(V0 + V1)*(ε0 + ε1)^2.25 + (288*λ0*(E0 + E1)*(v0 + v1)*(ε0m - ε0p + ε1m - ε1p))/h + (672*χ0*(E0 + E1)*(v0 + v1)*(ε0m - ε0p + ε1m - ε1p))/h - (120*λ0*(E0 + E1)*(v0 + v1)^3*(ε0m - ε0p + ε1m - ε1p))/h - (312*χ0*(E0 + E1)*(v0 + v1)^3*(ε0m - ε0p + ε1m - ε1p))/h + (6*λ0*(E0 + E1)*(v0 + v1)^5*(ε0m - ε0p + ε1m - ε1p))/h + (30*χ0*(E0 + E1)*(v0 + v1)^5*(ε0m - ε0p + ε1m - ε1p))/h + (3*λ0*(E0 + E1)*(v0 + v1)^7*(ε0m - ε0p + ε1m - ε1p))/(2.0*h) + (3*χ0*(E0 + E1)*(v0 + v1)^7*(ε0m - ε0p + ε1m - ε1p))/(2.0*h) - (1024*2^0.75*(v0 + v1)*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25*(ε0m - ε0p + ε1m - ε1p))/h + (512*2^0.75*(v0 + v1)^3*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25*(ε0m - ε0p + ε1m - ε1p))/h - (64*2^0.75*(v0 + v1)^5*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25*(ε0m - ε0p + ε1m - ε1p))/h - (96*λ0*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 + (24*λ0*(v0 + v1)^2*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 - (96*χ0*(v0 + v1)^2*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 + (6*λ0*(v0 + v1)^4*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 + (48*χ0*(v0 + v1)^4*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 - (3*λ0*(v0 + v1)^6*(ε0m - ε0p + ε1m - ε1p)^2)/(2.0*h^2) - (6*χ0*(v0 + v1)^6*(ε0m - ε0p + ε1m - ε1p)^2)/h^2 - (24*(1 - (v0 + v1)^2/4.)*(ε0 + ε1)*(384*h^2*χ0*(E0 - E1) - h*k*(λ0 + χ0)*(E0m - E0p + E1m - E1p)*(v0 + v1)^5 + 16*h*k*(E0 + E1)*((λ0 + 7*χ0 + ((-4*η0 + 11*λ0 + 9*χ0)*(v0 + v1)^2)/4.)*(v0m - v0p + v1m - v1p) - 2*h*(v0 + v1)*(5*λ0 + 7*χ0 + ((-2*η0 + λ0 + χ0)*(v0 + v1)^2)/4.)*(V0 + V1)) + 16*k*(v0 + v1)*(h*(3*λ0 + 7*χ0)*(E0m - E0p + E1m - E1p) + (η0 - 2*λ0 - 3*χ0)*(v0m - v0p + v1m - v1p)*(ε0m - ε0p + ε1m - ε1p)) - 4*k*(v0 + v1)^3*(2*h*(λ0 + 3*χ0)*(E0m - E0p + E1m - E1p) + (λ0 + χ0)*(v0m - v0p + v1m - v1p)*(ε0m - ε0p + ε1m - ε1p)) + 80*h*k*λ0*(V0 + V1)*(ε0m - ε0p + ε1m - ε1p) + 48*h*k*χ0*(V0 + V1)*(ε0m - ε0p + ε1m - ε1p) - 64*k*λ0*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p) + 4*(v0 + v1)^2*(16*h^2*(λ0 - χ0)*(E0 - E1) - h*k*(4*η0 - 7*λ0 - 13*χ0)*(V0 + V1)*(ε0m - ε0p + ε1m - ε1p) - 16*k*χ0*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p)) - 4*(v0 + v1)^4*(2*h^2*(2*λ0 + χ0)*(E0 - E1) - k*(λ0 + 4*χ0)*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p))))/(h^2*k)
end
 
function F2(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return -768*h^2*k*(E0 + E1)^2*(v0 + v1)*(1 - (v0 + v1)^2/4.)^2*(λ0 + 4*χ0 + (λ0*(v0 + v1)^2)/4.) + 256*h*k*(E0 + E1)*(1 - (v0 + v1)^2/4.)*(3*(v0 + v1)*(4*η0 - 7*λ0 - 13*χ0 - ((5*λ0 + 3*χ0)*(v0 + v1)^2)/4.)*(v0m - v0p + v1m - v1p)*(ε0 + ε1) + 48*h*(λ0 + χ0 - ((η0 - 2*λ0 - 3*χ0)*(v0 + v1)^2)/4.)*(V0 + V1)*(ε0 + ε1) + 32*2^0.75*h*(v0 + v1)*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 - 8*2^0.75*h*(v0 + v1)^3*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^1.25 + 3*(1 - (v0 + v1)^2/4.)*(λ0 + χ0 + ((3*λ0 + 7*χ0)*(v0 + v1)^2)/4.)*(ε0m - ε0p + ε1m - ε1p)) - 48*h*k*(v0 + v1)^6*(ε0 + ε1)*((3*λ0 + 7*χ0)*(E0m - E0p + E1m - E1p) + 2*2^0.75*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25*(ε0m - ε0p + ε1m - ε1p)) - 256*(v0 + v1)^2*(ε0 + ε1)*(3*h*k*(λ0 + 5*χ0)*(E0m - E0p + E1m - E1p) - 8*(k*(2*η0 + 3*λ0 + χ0)*(v0m - 2*v0 + v0p + v1m - 2*v1 + v1p) + 4*h^2*(η0 - χ0)*(V0 - V1))*(ε0 + ε1) - k*(v0m - v0p + v1m - v1p)*(h*(32*η0 - 45*λ0 - 29*χ0)*(V0 + V1)*(ε0 + ε1) + 3*(η0 + 2*λ0 + 3*χ0)*(ε0m - ε0p + ε1m - ε1p)) + 2*2^0.75*h*k*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25*(ε0m - ε0p + ε1m - ε1p)) - 512*(ε0 + ε1)*(6*h*k*(λ0 + χ0)*(E0m - E0p + E1m - E1p) + 8*(k*(4*η0 - χ0)*(v0m - 2*v0 + v0p + v1m - 2*v1 + v1p) + 6*h^2*λ0*(V0 - V1))*(ε0 + ε1) - 2*h*k*(V0 + V1)*(ε0 + ε1)*((8*η0 - 9*λ0 - 5*χ0)*(v0m - v0p + v1m - v1p) + 8*2^0.75*h*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25) + 3*k*(2*η0 - λ0 - χ0)*(v0m - v0p + v1m - v1p)*(ε0m - ε0p + ε1m - ε1p) + 4*2^0.75*h*k*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25*(ε0m - ε0p + ε1m - ε1p)) + 32*(v0 + v1)^4*(ε0 + ε1)*(6*h*k*(5*λ0 + 13*χ0)*(E0m - E0p + E1m - E1p) - 8*(3*k*(2*λ0 + χ0)*(v0m - 2*v0 + v0p + v1m - 2*v1 + v1p) + 2*h^2*(4*η0 - 3*λ0 - 4*χ0)*(V0 - V1))*(ε0 + ε1) - 4*h*k*(V0 + V1)*(ε0 + ε1)*(3*(λ0 + χ0)*(v0m - v0p + v1m - v1p) + 4*2^0.75*h*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25) - 3*k*(5*λ0 + 7*χ0)*(v0m - v0p + v1m - v1p)*(ε0m - ε0p + ε1m - ε1p) + 20*2^0.75*h*k*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^0.25*(ε0m - ε0p + ε1m - ε1p)) + 12*(v0 + v1)^5*(16*h*k*(λ0 + χ0)*(V0m - V0p + V1m - V1p)*(ε0 + ε1)^2 - k*(2*λ0 - 5*χ0)*(ε0m - ε0p + ε1m - ε1p)^2 + 4*(ε0 + ε1)*(8*h^2*(λ0 - 4*χ0)*(E0 - E1) + h*k*(λ0 + 7*χ0)*(V0 + V1)*(ε0m - ε0p + ε1m - ε1p) + 4*k*(2*λ0 - 5*χ0)*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p))) - 16*(v0 + v1)^3*(48*h^2*k*(4*η0 - 3*λ0 - 4*χ0)*(V0 + V1)^2*(ε0 + ε1)^2 - 4*k*(9*(2*λ0 + χ0)*(v0m - v0p + v1m - v1p)^2 - 8*h*(4*η0 - 3*λ0 - χ0)*(V0m - V0p + V1m - V1p))*(ε0 + ε1)^2 - 64*2^0.75*h*k*sqrt(1 - (v0 + v1)^2/4.)*(v0m - v0p + v1m - v1p)*(ε0 + ε1)^2.25 + 24*h*k*(2*η0 - 5*λ0 - χ0)*(V0 + V1)*(ε0 + ε1)*(ε0m - ε0p + ε1m - ε1p) - 3*k*(4*λ0 - χ0)*(ε0m - ε0p + ε1m - ε1p)^2 - 48*(ε0 + ε1)*(2*h^2*(λ0 + 8*χ0)*(E0 - E1) - k*(4*λ0 - χ0)*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p))) - 3*(v0 + v1)^7*(3*k*χ0*(ε0m - ε0p + ε1m - ε1p)^2 + 16*(ε0 + ε1)*(2*h^2*λ0*(E0 - E1) - 3*k*χ0*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p))) - 64*(v0 + v1)*(16*h^2*k*(8*η0 - 21*λ0 - 8*χ0)*(V0 + V1)^2*(ε0 + ε1)^2 + 4*k*((20*η0 - 12*λ0 - 11*χ0)*(v0m - v0p + v1m - v1p)^2 - 4*h*(8*η0 - 9*λ0 - 5*χ0)*(V0m - V0p + V1m - V1p))*(ε0 + ε1)^2 + 64*2^0.75*h*k*sqrt(1 - (v0 + v1)^2/4.)*(v0m - v0p + v1m - v1p)*(ε0 + ε1)^2.25 - 12*h*k*(4*η0 - 11*λ0 - 9*χ0)*(V0 + V1)*(ε0 + ε1)*(ε0m - ε0p + ε1m - ε1p) + 3*k*(2*λ0 + χ0)*(ε0m - ε0p + ε1m - ε1p)^2 + 48*(ε0 + ε1)*(2*h^2*(λ0 + 4*χ0)*(E0 - E1) - k*(2*λ0 + χ0)*(ε0m - 2*ε0 + ε0p + ε1m - 2*ε1 + ε1p)))
end

function F3(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return (-E0 - E1)/2. + (-ε0 + ε1)/k
end

function F4(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return (-v0 + v1)/k + (-V0 - V1)/2.
end

# now write jacobian of the advanced Fi functions wrt to the four variables V ≡ \dot{v}, E ≡ \dot{ε}, v and ε. The jacobian is only non zero in row i at colums i-1, i, and i+1 (and is diagonal
# for the equations for v and ε)
module Function1

function Jacobian_F1_V_j_m(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return (-512*(1 - (v0 + v1)^2/4.)*(3*(λ0 + χ0) + ((-8*η0 + 9*λ0 + 5*χ0)*(v0 + v1)^2)/4.)*(ε0 + ε1)^2)/h
end

function Jacobian_F1_V_j_j(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return 32*((4*(8*h*(v0 + v1)*(1 - (v0 + v1)^2/4.)*(3*(2*λ0 + χ0) + ((-4*η0 + χ0)*(v0 + v1)^2)/4.) + k*(v0 + v1)*(16*η0 - 33*λ0 - 25*χ0 + (3*(8*η0 - 9*λ0 - 5*χ0)*(v0 + v1)^2)/4.)*(v0m - v0p + v1m - v1p) + 8*h*k*(3*(2*λ0 + χ0) + (3*(-4*η0 + 8*λ0 + 5*χ0)*(v0 + v1)^2)/4. + ((-4*η0 + χ0)*(v0 + v1)^4)/8.)*(V0 + V1))*(ε0 + ε1)^2)/(h*k) + 64*2^0.75*(v0 + v1)*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^2.25 - 16*2^0.75*(v0 + v1)^3*sqrt(1 - (v0 + v1)^2/4.)*(ε0 + ε1)^2.25 + (3*(1 - (v0 + v1)^2/4.)*(ε0 + ε1)*(8*h*(E0 + E1)*(v0 + v1)*(5*λ0 + 7*χ0 + ((-2*η0 + λ0 + χ0)*(v0 + v1)^2)/4.) - 20*λ0*(ε0m - ε0p + ε1m - ε1p) - 12*χ0*(ε0m - ε0p + ε1m - ε1p) + (4*η0 - 7*λ0 - 13*χ0)*(v0 + v1)^2*(ε0m - ε0p + ε1m - ε1p)))/h)
end

function Jacobian_F1_V_j_p(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return (512*(1 - (v0 + v1)^2/4.)*(3*(λ0 + χ0) + ((-8*η0 + 9*λ0 + 5*χ0)*(v0 + v1)^2)/4.)*(ε0 + ε1)^2)/h
end

function Jacobian_F1_E_j_m(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
    η0::Float64, λ0::Float64, χ0::Float64)
    return (-6*(v0 + v1)*(-4 + v0^2 + 2*v0*v1 + v1^2)^2*(4*(3*λ0 + 7*χ0) + (λ0 + χ0)*v0^2 + 2*(λ0 + χ0)*v0*v1 + (λ0 + χ0)*v1^2)*(ε0 + ε1))/h
end

function Jacobian_F1_E_j_j(k::Float64, h::Float64, v0m::Float64, v0::Float64, v0p::Float64, ε0m::Float64, ε0::Float64, ε0p::Float64, V0m::Float64, V0::Float64, V0p::Float64, E0m::Float64, E0::Float64, E0p::Float64, v1m::Float64, v1::Float64, v1p::Float64, ε1m::Float64, ε1::Float64, ε1p::Float64, V1m::Float64, V1::Float64, V1p::Float64, E1m::Float64, E1::Float64, E1p::Float64,
